import React from "react";
import {
  Button,
  Card,
  Col,
  Container,
  FormGroup,
  Input,
  Row,
} from "reactstrap";
import "./css/generatareport.css";
import Select from "react-select";
const Reports = () => {
  return (
    <div className="page-content">
      <p className="reporttoplabel">Generate a report</p>
      <Card>
        <Container>
          <Row>
            <Col md={3}>
              <p className="reportlabel1 mt-4 ">Select your report type:</p>
            </Col>
            <Col md={3}></Col>
            <Col md={3}></Col>
            <Col md={3}></Col>
          </Row>

          <Row className="mt-4">
            <Col md={12}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
          </Row>

          <Row className="mt-4">
            <Col md={3}>
              <p className="reportlabel1">Select a time period</p>
            </Col>
            <Col md={3}></Col>
            <Col md={3}></Col>
            <Col md={3}></Col>
          </Row>

          <Row className="mt-2">
            <Col md={3}>
              <p className="reportlabel2">From</p>
            </Col>
            <Col md={3}>
              <p className="reportlabel2">To</p>
            </Col>
            <Col md={3}>
              <p className="reportlabel2">Time Slot</p>
            </Col>
            <Col md={3}></Col>
          </Row>

          <Row>
            <Col md={3}>
              <FormGroup>
                <Input
                  // format="HH:mm:ss.SSS"
                  type="time"
                  // defaultValue={locationBrandData.startTime}
                  // value="13:00"
                  // onChange={(e) => {
                  //   startTimeFunc(e);
                  // }}
                  id="appt-time"
                />
              </FormGroup>
            </Col>
            <Col md={3}></Col>
            <Col md={6}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
          </Row>

          <Row className="mt-4">
            <Col md={3}>
              <p className="reportlabel1">Make your selections</p>
            </Col>
            <Col md={3}></Col>
            <Col md={3}></Col>
            <Col md={3}></Col>
          </Row>

          <Row className="mt-2">
            <Col md={6}>
              <p className="reportlabel2">Diom Brand(s)</p>
            </Col>
            <Col md={6}>
              <p className="reportlabel2">Diom Location(s)</p>
            </Col>
          </Row>

          <Row>
            <Col md={6}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
            <Col md={6}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
          </Row>

          <Row className="mt-4">
            <Col md={12}>
              <p className="reportlabel2">Resource Type(s)</p>
            </Col>
          </Row>

          <Row>
            <Col md={12}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
          </Row>

          <Row className="mt-4">
            <Col md={6}>
              <p className="reportlabel2">User Type(by Position)</p>
            </Col>

            <Col md={6}>
              <p className="reportlabel2">User Type(by Industry)</p>
            </Col>
          </Row>

          <Row>
            <Col md={6}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
            <Col md={6}>
              <Select
                // value={selectedMulti}
                // isMulti={true}
                // onChange={this.handleMulti}
                classNamePrefix="select2-selection"
              />
            </Col>
          </Row>

          <Row className="mt-5">
            <Col md={3}></Col>
            <Col md={5}></Col>
            <Col md={2}>
              <Button>Clear All</Button>
            </Col>
            <Col md={2}>
              <Button>Export</Button>
            </Col>
          </Row>

          <p></p>
        </Container>
      </Card>
    </div>
  );
};

export default Reports;
